    "text": "'use strict';\n\n/*!\n * Related blade php view on resources/views/www/layout/index.blade.php\n */\nss.require(['framework', 'lightslider', 'geoip', 'gallerybox', 'stickynav'], function() {\n\tlet _position = {};\n\tlet _lang = ss.browserLanguage();\n\n\t$(document).ready(function() {\n\t\t/* initialize HTML elements */\n\t\tinitialize();\n\n\t\t/* add all page handler */\n\t\taddPageHandlers();\n\n\t\t/* parse url and execute actions */\n\t\tss.Modal.onAction(window.location.href);\n\n\t\t/* open update channel for member */\n\t\t// require sse\n\t\t//if (ss.uriGet('hub')) { ss.SSE.open('live'); }\n\n\t\tlet emailToken = ss.uriGetParams(window.location, 'email_token');\n\t\t// if email token is there in the url open popup\n\t\tif(emailToken) {\n\t\t\t// $('body').loading('overlay', 'show');\n\t\t\tss.get(ss.route('api.email.verification', {'email_token': emailToken}))\n\t\t\t\t.done(function(result) {\n\t\t\t\t\tss.setCookie('token', result.data.token);\n\t\t\t\t\tss.Modal.popup({\n\t\t\t\t\t\ttitle: 'Success',\n\t\t\t\t\t\tmessage: 'Congratulations, your email address has been confirmed! Please complete your profile information by clicking the button below.',\n\t\t\t\t\t\tbuttonText: 'COMPLETE MY PROFILE',\n\t\t\t\t\t\tbuttonUrl: result.data.redirect_url,\n\t\t\t\t\t});\n\t\t\t\t}).catch(function(error) {\n\t\t\t\t\tvar res = error.responseJSON;\n\t\t\t\t\tss.Modal.popup({\n\t\t\t\t\t\ttitle: 'Error!',\n\t\t\t\t\t\tmessage: res.message,\n\t\t\t\t\t\tstatus: 'fail'\n\t\t\t\t\t});\n\t\t\t\t});\n\n\t\t}\n\t});\n\n\t// function urlPageAction() {\n\t//     let url = {};\n\t//     ss.modal.uriAction();\n\t//     /* open password reset modal */\n\t//     if (ss.uriGet('pwd_token')) {\n\t//         url = ss.route('view.account.password.reset', { pwd_token: ss.uriGet('pwd_token') });\n\t//         ss.Modal.get(url);\n\t//     }\n\t//     if (ss.uriGet('login')) {\n\t//         ss.Modal.get(ss.route('view.account.login'));\n\t//     }\n\t//     /* open verification modal */\n\t//     ss.Modal.uriGet('email_token', 'api.email.verification');\n\t//     if (ss.uriGet('email_token')) {\n\t//         url = ss.route('email_token', { token: ss.uriGet('email_token') });\n\t//         ss.Modal.get(url).success(function (data) { ss.setCookie('token', data.token, data.ttl); });\n\t//     }\n\t// }\n\n\t/* Catch of the day - fetch remote data from server */\n\tfunction loadExclusive() {\n\t\t$('#catch-of-the-day-container').applyTemplate({\n\t\t\ttemplate: 'category_items',\n\t\t\turl: ss.route('api.news.people', {page: 1}),\n\t\t\ttype: 'POST',\n\t\t\tdata: {search_for: 'boost', page_size: '20', lat: _position.lat, lng: _position.lng, language: _lang},\n\t\t\tmode: 'replace',\n\t\t}).done(function(resp) {\n\t\t\t/* append AD if profiles are not found. */\n\t\t\tif (resp.data.length < 20) {\n\t\t\t\tvar beExclusiveRoute = ss.route('view.service.beexclusive');\n\t\t\t\tfor (var i = 0; i < (20 - resp.data.length); i++) {\n\t\t\t\t\tresp.dom.append(\n\t\t\t\t\t\t'<div class=\"item media-gallery ad\">' +\n                        '   <a href=\"#\">' +\n                        '   <div class=\"image bg-transfer\" style=\"background-image: url(\\'https://s3.eu-central-1.amazonaws.com/catchmenow/advertising/catch_of_the_day/7.png\\')\"></div>' +\n                        '   </a>' +\n                        '   <div class=\"additional-info\">' +\n                        '       <div>&nbsp;</div>' +\n                        '   <div class=\"controls-more\">' +\n                        '       <ul>' +\n                        '       <li><a href=\"' + beExclusiveRoute + '\" data-modal=\"open\">Be exclusive</a></li>' +\n                        '       </ul>' +\n                        '   </div>' +\n                        '</div>' +\n                        '</div>'\n\t\t\t\t\t);\n\t\t\t\t}\n\t\t\t}\n\n\t\t\t/* adding rating stars and media gallery */\n\t\t\tresp.dom.stars();\n\t\t\tresp.dom.find('.item:not(.ad) > a').on('click', function(e) {\n\t\t\t\te.preventDefault();\n\t\t\t\tss.Gallerybox.openModal($(this).data('person-id'), 'person');\n\t\t\t});\n\n\t\t\t/* init carousel */\n\t\t\tvar slider = resp.dom.lightSlider({\n\t\t\t\titem: 20,\n\t\t\t\tpager: false,\n\t\t\t\tcontrols: false,\n\t\t\t\trtl: false,\n\t\t\t\tloop: false,\n\t\t\t\tfreeMove: true,\n\t\t\t\tautoWidth: true,\n\t\t\t\tenableTouch: true,\n\t\t\t\tenableDrag: true,\n\t\t\t\tonSliderLoad: function() {\n\t\t\t\t\t$('.light-carousel').removeClass('light-carousel-hidden');\n\t\t\t\t}\n\t\t\t});\n\t\t\t$('.button-prev').click(function() { slider.goToPrevSlide(); });\n\t\t\t$('.button-next').click(function() { slider.goToNextSlide(); });\n\t\t});\n\t}\n\n\tfunction load(e, mode = 'replace') {\n\t\tlet $button = $(e);\n\t\tlet url = $button.attr('href');\n\t\tlet container = $button.data('target');\n\t\tlet template = $button.data('template');\n\t\tlet filter = $button.data('filter');\n\t\tlet gallery = $(container).data('gallery');\n\t\tif (mode !== 'replace') { $button.loading('button', 'show'); }\n\n\t\t$(container).applyTemplate({\n\t\t\ttype: 'POST',\n\t\t\ttemplate: template,\n\t\t\turl: url,\n\t\t\tmode: mode,\n\t\t\tdata: {search_for: filter, lat: _position.lat, lng: _position.lng, language: _lang}\n\t\t}).done(function(resp) {\n\t\t\t/* hide the load button if there are no more data */\n\t\t\tresp.pager.last ?\n\t\t\t\t$button.addClass('hidden') :\n\t\t\t\t$button.attr('href', resp.pager.url).removeClass('hidden');\n\n\t\t\t/* adding rating stars */\n\t\t\tresp.dom.stars();\n\n\t\t\t/* media gallery click event (not for events section) */\n\t\t\tif (gallery) {\n\t\t\t\tresp.dom.find('a.media-gallery').on('click', function(e) {\n\t\t\t\t\te.preventDefault();\n\t\t\t\t\tss.Gallerybox.openModal($(this).data('person-id'), 'person');\n\t\t\t\t});\n\t\t\t}\n\n\t\t\t/* hiding the button animation */\n\t\t\tif (mode !== 'replace') { $button.loading('button', 'hide'); }\n\t\t});\n\t}\n\n\tfunction initialize() {\n\t\t/* get location */\n\t\tss.Geoip.locate().then(res => {\n\t\t\t_position.lng = res.coords.lng;\n\t\t\t_position.lat = res.coords.lat;\n\n\t\t\t/* fetch remote data from server */\n\t\t\tloadExclusive();\n\t\t\t$('[data-template]').each(function() { load(this, 'replace'); });\n\t\t});\n\n\t\t/* create a fixed sticky menu */\n\t\t$('.sticky-menu').smoothMenu({stickyMenu: true, slidingLine: true, menuSpeedAnimate: 300, pageNavigationSpeedAnimate: 700});\n\n\t\t/* dispaly animation for right sidebar */\n\t\t$('.hero-section.has-map .results-wrapper').css('visibility', 'visible').animate({opacity: 1.0}, 500);\n\t}\n\n\tfunction addPageHandlers() {\n\t\t/* load more button event */\n\t\t$('[data-template]').on('click', function(e) {\n\t\t\te.preventDefault();\n\t\t\tload(e.currentTarget, 'append');\n\t\t});\n\n\t\t/* edit event */\n\t\t$('#edit-event').on('click', function(e) {\n\t\t\te.preventDefault();\n\t\t\tss.get(ss.route('api.event.draft'))\n\t\t\t\t.done(function(result) {\n\t\t\t\t\tif (result.status === 'success') {\n\t\t\t\t\t\twindow.location.href = result.data.url;\n\t\t\t\t\t} else {\n\t\t\t\t\t\tss.notify({text: result.message, type: result.status, target: 'page'});\n\t\t\t\t\t}\n\t\t\t\t});\n\t\t});\n\t}\n});\n"
